PriceConverter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";//this is a github file to get price conversion

// Why is this a library and not abstract?
// Why not an interface?
contract PriceConverter {//creating a library
    // We could make this public, but then we'd have to deploy it
    function getPrice() public view returns (uint256) {
        // Goerli ETH / USD Address
        // https://docs.chain.link/docs/ethereum-addresses/
        AggregatorV3Interface priceFeed = AggregatorV3Interface(
            0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419//address is copied from chainlink website in ethereum data feeds
        );
        (, int256 answer, , , ) = priceFeed.latestRoundData();//AggregatorV#interface file function
        // ETH/USD rate in 18 digit
        return uint256(answer * 1e18);
    }

    // 1000000000
    function getConversionRate(uint256 ethAmount)
        public
        view
        returns (uint256)
    {
        uint256 ethPrice = getPrice();
        uint256 ethAmountInUsd = (ethPrice * ethAmount) / 1e18;
        // the actual ETH/USD conversion rate, after adjusting the extra 0s.
        return ethAmountInUsd;
    }
}

